import React from "react";
import "../styles/Interview.css";

const Interview = () => {
  return (
    <div className="page">
      <h2>Interview Preparation</h2>
      <p>Placement papers, group discussions, and HR interview tips.</p>
    </div>
  );
};

export default Interview;
